package com.technology.showcase.dao;

import static com.technology.jef.server.serialize.SerializeConstant.PARAMETER_NAME_VALUE_SEPARATOR;

import java.util.LinkedList;
import java.util.List;

import com.technology.jef.server.dto.OptionDto;
import com.technology.jef.server.dto.RecordDto;
import com.technology.jef.server.exceptions.ServiceException;

public class AchievementTypeDao extends H2Dao {

	public static final String NAME = "name";
	public static final String ABOUT = "about";
	public static final String IMAGE = "image";

	private static final String[] A_TYPES = new String[] {
			"Orden Trudovogo Krasnogo Znameni", 
			"Order of Lenin",
			"Order of Friendship of Peoples",
			"Order of the Red Banner",
			"Order of the Badge of Honour",
			"Liberation of Siberia",
			"Ekaterinoslavsky (\"Winter\") campaign",
			};
	private static final String[] ABOUTS = new String[] {
			"Honour great deeds and services to the Soviet state and society in the fields of production, science, culture, literature, the arts, education, health, social and other spheres of labour activities",
			"The order was the highest civilian decoration bestowed by the Soviet Union",
			"Administrative subdivisions of the USSR for accomplishments in strengthening of inter-ethnic and international friendship and cooperation, for economical, political, scientific, military, and cultural development",
			"Extraordinary heroism, dedication, and courage demonstrated on the battlefield",
			"Outstanding achievements in production, scientific research and social, cultural and other forms of social activity",
			"White movement order. Political contra-distinction to \"the Reds\", whose revolutionary Red Army supported the Bolshevik government",
			"Ekaterinoslavsky (\"Winter\") movement participants",
			};
	private static final String[] IMAGES = new String[] 
			{"data:image/png;base64,",
			"data:image/png;base64,",
			"data:image/png;base64,",
			"data:image/png;base64,",
			"data:image/png;base64,",
			"data:image/png;base64,",
			"data:image/png;base64,",
			};
	
 
	public AchievementTypeDao() throws ServiceException {
		super();
	}
	
	@Override
	public void init() throws ServiceException {
		super.init();
		
		for (int i = 0; i<7; i++) {
			RecordDto record = new RecordDto();
			int type = (int) (Math.random() * 3);
			record.put(NAME, A_TYPES[i]);
//							+ PARAMETER_NAME_VALUE_SEPARATOR
//							+ "<div style='display: table;'>" 
//							+ "<div style='display: block; float: left;'>" + ABOUTS[type] + "</div>" 
//							+ "<div style='display: block; float: left;'><img src='" + IMAGES[type] + "'/> </div>" 
//							+ "</div>" 
//			);
			record.put(ABOUT, ABOUTS[i]);
			record.put(IMAGE, IMAGES[i]);
			super.create(record);
		}
	}
	


	@Override
	public String getTable() {
		return "achievement_type";
	}

	@Override
	public String getKey() {
		return "id";
	}
	
	@Override
	public List<OptionDto> getOptions() throws ServiceException {
		List<OptionDto> options = new LinkedList<OptionDto>();
		for (OptionDto option: super.getOptions()) {
			RecordDto record = load(Integer.parseInt((String)option.getValue()));
			options.add(new OptionDto(
					record.get(NAME)
					+ PARAMETER_NAME_VALUE_SEPARATOR
					+ "<div style='display: table;'>" 
					+ "<div style='display: block; float: left;'>" + record.get(ABOUT) + "</div>" 
					+ "<div style='display: block; float: left;'><img src='" + record.get(IMAGE) + "'/> </div>" 
					+ "</div>" 
					, option.getValue()));
		}
		return options;
	}

	@Override
	public LinkedList<DataField> getFields() throws ServiceException  {

		return new LinkedList<DataField>(){{
			add(new DataFieldString(NAME));
			add(new DataFieldString(ABOUT));
			add(new DataFieldClob(IMAGE));
		}};
	}

}
